import React, {Component} from 'react';

class Footer extends Component{
  render(){
    return(
      <div id="footer" className="navbar navbar-expand p-0" style={{bottom:'0',position:'absolute'}}>
        <ul className="col-12 navbar-nav">
          <li className="col text-center navbar-item px-0 "><a className="navbar-link" href="#home">Home</a></li>
          <li className="col text-center navbar-item px-0 "><a className="navbar-link" href="#about">About Us</a></li>
          <li className="col text-center navbar-item px-0 "><a className="navbar-link" href="form">Forms</a></li>
          <li className="col text-center navbar-item px-0 "><a className="navbar-link" href="#contact">Contact Us</a></li>
        </ul>
        <div className="col-md-4 text-right">Created By Gerard Cancino</div>
      </div>
    );
  }
}

export default Footer;
